In order to use Geo-AID, we have to tell it exactly what we want. We can do this with a script file. Geo-AID uses a special language called GeoScript that lets us give specific instructions. Create the following file with a name of your choice, say figure.geo: let A = Point();
let B = Point();
let C = Point(); AB = AC;
AB = BC; and run it with the following command: geo-aid figure.geo After a short wait a new file figure.svg should show up. Open it in any SVG previewer (could even be your browser) and gaze at your first figure in awe: Ok, but what exactly happened here? Let's take a closer look at the script we've just given to Geo-AID: First, we have the three let statements. These statements are used to create variables. In our case, these variables are points created with the Point() function. You can also add special display properties to the variable definitions to change how they are rendered. For example, if you change the first line to the following: let A [label = G] = Point(); you should get something like this: You can find out more about the display system here . After the variable definitions, we have the two lines: AB = AC;
AB = BC; These are called rule statements. They represent a relationship between the left hand side and the right hand side. In this case, the relationship is the equality of lengths AB, BC and AC. It's worth noting that the equality sign represents a rule , not a definition or a redefinition . GeoScript is a description language, not a programming one. Geo-AID takes these requirements and attempts to create a figure that meets them. let statements and rules can be sometimes combined by adding rules after the left hand side of a let statement. For example: # This is a comment
let A = Point();
let B = Point();
let C = Point();
let r = dst(BC) < AB; let omega = Circle(A, r); Here, r is set to the distance BC and said to be smaller than AB.

